import { useState, useEffect, useRef } from 'react'

import firebase from 'firebase/app'
import 'firebase/firestore'

firebase.initializeApp({
  projectId: 'mouseion-tis-atmos'
})

const firestore = firebase.firestore()

export default function () {
  const [itemList, setItemList] = useState(new Array(100).fill().map((v, i) => i))
  const [page, setPage] = useState(0)

  useEffect(() => {
    console.log('Element initialised?')
  })

  return (
    <div class="bg-main py-12 md:py-20 text-white">
      <div class="mx-2 sm:mx-4 md:mx-8 lg:mx-16 xl:mx-30 2xl:mx-40">
        {
          itemList.map(i => (
            <h2 key={i}>{i}</h2>
          ))
        }

      </div>
    </div>
  )
}
